import './App.css';
import {
  MDBInputGroup,
  MDBBtn
} from 'mdb-react-ui-kit';

function App() {
  return (
    <div className="App">
      <header className='App-header'>
        <h1>To Do List App</h1>
        </header>
      <main className='container'>
        <form className='mt-3 mb-3'>

          <MDBInputGroup className='mb-3' textBefore='Enter the task:'>
            <input className='form-control' type='text' placeholder='Get groceries' />
            <MDBBtn color='success'>Add Task</MDBBtn>
          </MDBInputGroup>

        </form>
      </main>
    </div>
  );
}

export default App;
